import React from "react";
import { Header } from "../components/mollecules";
import { FaAngleLeft, FaAngleRight } from "react-icons/fa";
import { Button, Text } from "../components/atomes";

function Home() {
  return (
    <div>
      <Header.laptopHeader />
      <div className="w-full h-[80vh] bg-red-300">
        <div className="flex flex-row justify-between relative top-1/2 px-10">
          <Button.Left />
          <Button.Right />
        </div>
        <div className="relative top-1/3 left-1/4">
          <div>
            <Text.h3 color={"white"} fontSize={50}>
              Nouveautés 2023
            </Text.h3>
          </div>
          <Text.label color={"white"} fontSize={32}>
            Dom Pérignon
          </Text.label>
          <Button.Primary value={"Voir Plus"} />
        </div>
      </div>
    </div>
  );
}

export default Home;
